import React from 'react';
import back from "../images/BACK.webp";
import '.'

const Header = () => {
    return (
        <div style={{ position: "relative", height: "810px", width: "100%" }}>
            <img className='img' 
                src={back} 
                alt="Banner" 
                 
            />
            <h1 className="text">
                Content Creator Profile
            </h1>
        </div>
    );
};

export default Header;
